window.bookSummaryJSON = "<p>From<i> USA Today</i> best-selling author Ava Harrison comes an enemies-to-lovers, slow-burn romance with a twist. </p> <p>Trent Aldridge is the devil. </p> <p>Rich. Arrogant. Sinfully handsome. </p> <p>He holds my inheritance in his hands. Twenty-two million dollars I didn't even know about. I met him at a funeral. As one life ended, mine unraveled. Because he has one to ruin me. And Trent Aldridge never loses. My present is gone and my future is in ashes. All because of a past that's not even mine. </p> <p>Control. Power. </p> <p>He has it all now that I'm his maid. He's rude, sarcastic, and well...the hottest man I've ever met. Lust is a dangerous game to play. Where there's smoke, there's fire. And I'm about to light the match.</p>"; 
